import React, {useEffect} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import DataProvider from './components/redux/store'


ReactDOM.render(
  <React.StrictMode>
  <DataProvider>
    <App />
  </DataProvider>
</React.StrictMode>,
 document.getElementById('root')
);
